import React from 'react';

const UserInput = () => {

    const inputStyle = {
        border: '1px solid #333',
        padding: '10px',
        fontSize: '16px',
        borderRadius: '5px'
    };

    return(
        <div>
            <p><input style={inputStyle} type="text" /></p>
        </div>        
    );
}

export default UserInput;
